insert into recipe(id,name,description,chef_id,base64) values(nextval('recipe_seq'),'Spaghetti alla Carbonara','Il Vicolo della Scrofa, per chi conosce Roma,  una delle stradine pi caratteristiche e ricche di simboli. Proprio in una trattoria di questa strada, da cui il nome del vicolo, pare sia stata realizzata la prima carbonara, nel 1944. La storia pi attendibile su questo primo piatto, infatti, racconta l incontro tra gli ingredienti a disposizione dei soldati americani e la fantasia di un cuoco romano. Il risultato fu il prototipo degli spaghetti alla carbonara: uova, bacon (poi guanciale) e formaggio. Man a mano la ricetta  evoluta fino a quella che tutti conosciamo oggi e possiamo apprezzare a casa di amici romani veraci (e voraci!), nelle trattorie come nei ristoranti stellati della Capitale, in tutta Italia e all estero, nelle innumerevoli versioni: con o senza pepe, con un tuorlo per persona o l aggiunta di almeno un uovo intero, con guanciale o pancetta tesa.',1,'{,}');
insert into recipe(id,name,description,chef_id,base64) values(nextval('recipe_seq'),'Spaghetti all Amatriciana','Si dice che questo famoso primo piatto nato ad Amatrice fosse il pasto principale dei pastori, ma originariamente era senza pomodoro e prendeva il nome di gricia. Il pomodoro fu aggiunto in seguito, quando venne importato dalle Americhe e il condimento prese il nome di Amatriciana.',1,'{,}');
